import './App.css';
import Home from './Routes/Home';
import { ChakraProvider } from '@chakra-ui/react';
import { BrowserRouter } from 'react-router-dom';
import NavBar from './Components/Navbar';
import AllRoutes from './Routes/AllRoutes';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <ChakraProvider>
        <NavBar/>
        <AllRoutes/>
      </ChakraProvider>
      </BrowserRouter>
    </div>
  );
}

export default App;
